class LogoLoader extends React.Component {
  render() {
    const theme = this.props.theme;
    return (
      <div style={{ textAlign: "center" }}>
        <svg
          className="raw_logo"
          width="200"
          height="200"
          viewBox="0 0 440 305"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          {/* Hexagone ou formes d√©coratives */}
          <path
            className="myHexagon"
            d="M293.545 167.405L229.5 204.381..."
            stroke={theme.body}
            strokeWidth="4"
          />
          {/* Initiales */}
          <text
            x="50%"
            y="50%"
            textAnchor="middle"
            dominantBaseline="middle"
            fontSize="80"
            fill={theme.body}
            fontFamily="Arial, sans-serif"
          >
            WD
          </text>
        </svg>

        {/* Nom complet */}
        <div style={{ color: theme.body, marginTop: "10px", fontSize: "24px" }}>
          Wissam Draou
        </div>
      </div>
    );
  }
}
